  \"Avian inventory and monitoring at Arrowwood National Wildlife Refuge, North Dakota
  : 1995-1998\",\n\t\"tracking_summary\": {\n\t\t\"total\": 3,\n\t\t\"recent\": 1\n\t},\n\t\"groups\":
  [],\n\t\"relationships_as_subject\": [],\n\t\"revision_timestamp\": \"2016-07-27T23:05:13.422045\",\n\t\"name\":
  \"avian-inventory-and-monitoring-at-arrowwood-national-wildlife-refuge-north-dakota-1995-199\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"In 1995, a breeding bird inventory and
  monitoring program was initiated at Arrowwood National Wildlife Refuge, North Dakota.
  Surveys were conducted annually through 1998 from an extensive point count array
  permanently located across four management units (n = 162). The goal of the program
  was to obtain a comprehensive inventory of the breeding bird community over time,
  in association with habitat features common to the refuge. We also explored potential
  biases of using roadside point counts to estimate bird community parameters. A total
  of 76 bird species were identified across 7371 observations over four years, including
  40 passerines, 5 raptor species, and 22 waterbird species. Clay-colored Sparrows,
  Brown-headed Cowbirds and Red-winged Blackbirds were the most commonly observed
  landbirds; Mallards, Ring-billed Gulls and Blue-winged Teals were the most commonly
  observed waterbirds. Common Yellowthroats and Bobolinks were the only species that
  showed consistent declines in relative abundance and distribution over the course
  of the program, which may warrant further investigation. Several waterfowl species
  exhibited cyclical patterns in abundance, while many other species exhibited strong
  yearly variation in counts.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
